            .then(res => this.setState({apiResponse: res}))
            .catch(err => err);
    }

    componentDidMount(){
        this.callAPI();
    }*/

    render(){
        return <>
        <Navbar></Navbar>
            <Switch>
                <Route exact path="/" component={Home}></Route>
                <Route exact path="/list/" component={List}></Route>
                <Route exact path="/list/:element" component={Details}></Route>
                <Route component={Error}></Route>
            </Switch>
            <Footer></Footer>
        </>;
    }
}

export default App;
